import React from "react";

const ListUser = (props) => {
  console.log("listuser list ", props.userList);

  return (
    <div>
      {props.userList.forEach((user) => {
        <li>
          <ul>
            {user.username} {user.age}
          </ul>
        </li>;
      })}
    </div>
  );
};

export default ListUser;
